import React from 'react'
import Sidebar from '../Nav/Sidebar'
import Lebenslauf from '../components/Lebenslauf'
import Vorstellung from '../components/Vorstellung'


import styled from "styled-components";

const Container = styled.div`
    width:100vw;
    height:100vh;
    display:flex;
    justify-content:center;
    align-items:center;
`

const Sections = styled.div`
    margin:0;
    @media (min-width: 48em) {
        margin-left:calc(var(--sidebar-width));
        margin-right:calc(var(--sidebar-width));
    }  
    @media (min-width: 64em) {
    }      
`

export default function Resume() {

    const data=[
        {
            id:'vorstellung',
            label:'Vorstellung',
        },
        {
            id:'lebenslauf',
            label:'Lebenslauf',
        },
    ]

    return (
        <Container>
            <Sections>
                <div id='vorstellung'><Vorstellung/></div>
                <div id='lebenslauf'><Lebenslauf/></div>
            </Sections>
            <Sidebar data={data}/>
        </Container>

    )
}
